import './App.css';
import Logo from "./logo";
import Welcome from "./welcome";
import Login from "./login";
import Signup from "./signup";
import Password from "./password";
import Otp from "./otp";
import Home from "./home";
import About from "./about";
import Contact from "./contact";
import Service from "./service";
import List from "./list";
import Soilmain from "./soil";
import Soilknow from "./soil1";
import Laterite from "./soil_1";
import Soiltest from "./soil2";
import Coimbatore from "./soil_2";
import Tractormain from "./tractor";
import Coimbatoret from "./tractor1";
import Schemas from "./schemas";
import Insurance from "./insurance";
import Statistics from "./statistics";
import Statisticsgraph from "./statistics1";




import {BrowserRouter as Router,Routes, Route} from "react-router-dom";

function App() {
  return (
    <Router>
      <div className='App'>

    <Routes>
       <Route exact path='./' element={Logo}></Route>
       <Route exact path='./logo' element={Logo}></Route>
       <Route path='./Welcome' element={<Welcome/>}></Route>
       <Route path='/Login' element={<Login/>}></Route>
       <Route path='/Signup' element={<Signup/>}></Route>
       <Route path='/Password' element={<Password/>}></Route>
       <Route path='Otp' element={<Otp/>}></Route>
       <Route path='Home' element={<Home/>}></Route>
       <Route path='About' element={<About/>}></Route>
       <Route path='Contact' element={<Contact/>}></Route>
       <Route path='Service' element={<Service/>}></Route>
       <Route path='List' element={<List/>}></Route>
       <Route path='Soilmain' element={<Soilmain/>}></Route>
       <Route path='Laterite' element={<Laterite/>}></Route>
       <Route path='Soilknow' element={<Soilknow/>}></Route>
       <Route path='Soiltest' element={<Soiltest/>}></Route>
       <Route path='Coimbatore' element={<Coimbatore/>}></Route>
       <Route path='Tractormain' element={<Tractormain/>}></Route>
       <Route path='Coimbatoret' element={<Coimbatoret/>}></Route>
       <Route path='Schemas' element={<Schemas/>}></Route>
       <Route path='Insurance' element={<Insurance/>}></Route>
       <Route path='Statistics' element={<Statistics/>}></Route>
       <Route path='Statisticsgraph' element={<Statisticsgraph/>}></Route>
</Routes>
      </div>
    </Router>
  )
}

export default App;
